    static void TxtToJson(string path, string dest)
    {
        List<BanObject> list = new();

        string text = File.ReadAllText(path);
        var lines = text.Split(new string[] { Environment.NewLine }, StringSplitOptions.None);
        foreach (var line in lines)
        {
            if (line == lines[0])
            {
                continue;
            }

            BanObject entry = new()
            {
                Name = line.Remove(18).Trim(),
                PID = line.Substring(18).Remove(15).Trim(),
                Reason = line.Substring(33).Remove(22).Trim(),
                Timestamp = line.Substring(55).Remove(20).Trim(),
                ExecBy = line.Substring(75).Trim(),
            };
            list.Add(entry);

            if (list.Count >= 10)
            {                
                //break;
            }

            //DEBUG
            //Debug.WriteLine($"{entry.Name}-{entry.PID}-{entry.Reason}-{entry.Timestamp}-{entry.ExecBy}");
        }
        Console.WriteLine($"Count: {list.Count}"); //4543

        list = list.OrderBy(o => o.Name).ToList();

        Thread.Sleep(1000);

        string json = JsonSerializer.Serialize(list);
        File.WriteAllText(dest, json);
    }
